export const merge = (
  arg: { [k: string]: any },
  base: { [k: string]: any }
) => {
  const result = { ...base };
  Object.keys(base).forEach((k) => {
    if (arg[k] && typeof arg[k] === "object" && arg[k] != null) {
      result[k] = merge(arg[k], base[k]);
    } else if (arg[k] != undefined) {
      result[k] = arg[k];
    } else {
      result[k] = base[k];
    }
  });
  return result;
};

